import JohnDoe from '../../assets/headshots/john_doe.jpeg';

const PersonCard = (props) => {

  const person = props.data;

  console.log(person)

  return (

    person ? 
      <article className="profile">
        <img src={JohnDoe} className="headshot" />
        <div className="profile-name">
          <h2>{person.name}</h2>
          <p className="highlighted">{person.bio}</p>
        </div>
      </article>
    : 
      ''

  )
}

export default PersonCard;
